export const addBook = book => {
    return {
        type: "ADD_BOOK",
        book: book
    }
}

export const fetchBooks = () => {
    fetch('http://localhost:3000/books')
    .then(resp => resp.json())
    .then(books => {
      books.map(book => dispatch(addBook(book)))
    })
}
